import React from "react";

export default function Onboarding() {
  return (
    <section className="bg-gradient-to-r from-yellow-200 to-red-200 dark:from-gray-700 dark:to-gray-900 p-6 rounded-xl my-6">
      <h3 className="text-2xl font-semibold mb-2">Quick Start Guide</h3>
      <ul className="list-disc ml-6 text-gray-800 dark:text-gray-200">
        <li>Connect your BNB Chain wallet.</li>
        <li>Explore market insights and predictions.</li>
        <li>Track your portfolio performance.</li>
      </ul>
    </section>
  );
}
